import React from 'react'
import './App.css'
import logo3 from './pymnt.PNG'
export const Paymants = () => {
    return (
        <div>
            <div><table className='pay-table'><tr><td><img class='img' style='width:200%;' src={logo3}/><label>Recevies</label></td><td>+15.08USD</td></tr></table></div>
            <div></div>
        </div>
    )
}
